import { types } from "mobx-state-tree";
import { User } from '../type/UserType';



const TodoModel = types
  .model({
    user: types.optional(User, {
      id: 0,
      name: '',
      email: '',
      role_name: '',
      role_slug: '',
    }),
    isLogin: types.optional(types.boolean, false)
  })
  .actions((self) => ({
    setUser(user: typeof User.Type) {
      self.user = user;
    },
    setIsLogin(isLogin: boolean) {
      self.isLogin = isLogin;
    }
  }));

// export default TodoModel;


type TTodoSnap = SnapshotOut<typeof TodoModel>;

const TodosModel = types
  .model({
    todos: types.optional(types.array(TodoModel), [])
  })
  .volatile(() => ({ input: "", indEdit: -1 }))
  .actions((self) => ({
    addTodo(todo: TTodoSnap) {
      self.todos.push(todo);
    },
    deleteTodo(ind: number) {
      self.todos.splice(ind, 1);
    },
    setInput(input: string) {
      self.input = input;
    },
    setIndexEdit(indEdit: number) {
      self.indEdit = indEdit;
    }
  }));

const todoModel = TodosModel.create();


class AuthStore {
  @observable user: User = {
    id: 0,
    name: '',
    email: '',
    role_name: '',
    role_slug: '',
  };

  @observable isLogin: boolean = false;

  @action
  setUser(user: User): void {
    this.user = user;
  }

  @action
  setIsLogin(isLogin: boolean): void {
    this.isLogin = isLogin;
  }
}

const authStore = new AuthStore();
export default authStore;
